import axios from "axios";
import { useState } from "react";

function TripItem() {
  const [trips, setTrips] = useState(null);

  axios.get("/api/v1/trips").then((res) => {
    const trips = res.data;
    setTrips(trips);
  });

  const ebe = trips.map((g) => <div>{g.name}</div>);
  return <div>{ebe}</div>;
}

export default TripItem;
